import React from "react";
import { useLocation } from "react-router-dom";

export default function ViewEmployee() {
  const location = useLocation();
  // const navigate = useNavigate();
  const { state } = location;

  // Check if state exists, otherwise redirect to another page
  if (!state) {
    // Redirect to another page
    // navigate("/error");
    return null; // Or render a loading indicator or error message
  }

  // Destructure properties from state
  const { empid, ename, designation, jdate, status } = state;

  // Render the component using the state data
  return (
    <div>
      <h1>Employee Details</h1>
      <p>Employee ID: {empid}</p>
      <p>Name: {ename}</p>
      <p>Designation: {designation}</p>
      <p>Joining Date: {jdate}</p>
      <p>Status: {status}</p>
    </div>
  );
}
